E_D("replace into `phome_ecms_infotmp_game` values('1173','17','http://www.61baobao.com/tingerge/10347/','0','2012-06-29 01:53:57','老实您辛苦了','2012-06-29 01:53:57','4usky','2','1340906037','','http://www.61baobao.com/common/flash/2011b/06/pic/0142.jpg','','0','','http://s.61baobao.com/common/flash/2011b/06/0142.swf','667','479','老实，您辛苦了，老实，为了学生为了给祖国培养人才，他们默默的付出着，一首《老实，您辛苦了》献给我们最敬爱的老实。','http://www.61baobao.com/common/flash/2011b/06/dpic/0142.jpg','10347','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1cE9IZE5WRkY1VEc1T00xcG5QVDA9','http://s.61baobao.com/common/flash/2011b/06/0142.swf','http://www.61baobao.com/common/flash/2011b/06/dpic/0142.jpg','http://www.61baobao.com/common/flash/2011b/06/pic/0142.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('1174','17','http://www.61baobao.com/tingerge/10346/','0','2012-06-29 01:53:57','狗狗未来不是梦','2012-06-29 01:53:57','4usky','2','1340906037','','http://www.61baobao.com/common/flash/2011b/06/pic/0141.jpg','','0','','http://s.61baobao.com/common/flash/2011b/06/0141.swf','667','479','鸡年过去了狗年要来到，我们都想要去放鞭炮， 向天空叫叫把尾巴摇摇，狗狗本命年马上要来到。 享受着阳光， 紫外线穿破臭氧会把皮肤晒伤。呼吸新鲜空气， 可吸入颗粒物超标最好别出去。 我要吃外卖， 一次性餐盒多数都不合格。 那我吃快餐， 当心苏丹红像可怕的毛毛虫。 那你说我们到底吃什么，总不能在家里干等着挨饿。 打开冰箱看一看是劣质的奶粉，还有包裹细菌可怕的保鲜膜。 听说就连牙膏还有不沾锅，都可能给我们带来恐怖病魔。 电脑、手机、微波炉到处都是辐射， 你说、你说，这日子怎么过？ 狗狗未来不是梦，要放心的过每一分钟， 不用担心毛毛虫，也不会为了吃而感到头疼。 狗狗未来不是梦，要健康的过每一分钟， 只要坚持做运动，一定会强壮得像头狗熊，壮得像头狗熊。 我想吃棒棒糖，吃多了影响健康而且还会发胖。 我想喝红高粱，喝高了容易误事还会损害肝脏。 可是工作压力大，要学会自我解压体力不能透支花。 总是心情不好，笑一笑十年少没有什么大不了。 你没听人家说过心理健康很重要吗？ 做男人最重要的就是心胸宽大。 任何事都以一颗平常心去对待它， 本命年咱的事业一定会有大变化。 你看看05年勇敢的小鸡、小鸭， 乐观的面对生活，精神多么伟大， 接下来2006就得看咱的啦！ 可不能丢人啊，站直了别趴下！ 狗狗未来不是梦，要勇敢的过每一分钟，忘掉所有的苦痛，摇摇尾巴去争取成功。 狗未来不是梦，要坚强的过每一分钟， 虽然不是优良品种，也要努力成为狗中英雄，成为狗中英雄！','http://www.61baobao.com/common/flash/2011b/06/dpic/0141.jpg','10346','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1cE9IZE5WRkY0VEc1T00xcG5QVDA9','http://s.61baobao.com/common/flash/2011b/06/0141.swf','http://www.61baobao.com/common/flash/2011b/06/dpic/0141.jpg','http://www.61baobao.com/common/flash/2011b/06/pic/0141.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('1175','17','http://www.61baobao.com/tingerge/10345/','0','2012-06-29 01:53:57','孩子和羽毛','2012-06-29 01:53:57','4usky','2','1340906037','','http://www.61baobao.com/common/flash/2011b/06/pic/0140.jpg','','0','','http://s.61baobao.com/common/flash/2011b/06/0140.swf','667','479','我象个孩子坐在树梢,摊开手掌接住一片羽毛,空气里水鸟细声歌唱,向树林里寻找留下记号,穿越黑暗城市我找到了你,披着白色羽毛,脸上的光亮反射向四周,我象个孩子一样,任性地欢笑贪婪地索要,星空下柔软海绵想念孤独的水鸟,你会带我温暖地飞啊，飞啊，毫无方向,你的气息是亲人的气息，让我失去了抵抗,闭上眼 世界很虚幻,时间是 凝固不动的,我不能 属于任何地点,抓住我 不要放手,我象个孩子用眼泪说话,每个夜晚掉落许多羽毛,没有人知道我能飞翔,从天空里降落到遥远的海岸,在寂寞飞行中我对你说话,那奇妙的地方藏着秘密的梦中之国,我象个孩子一样,任性地欢笑,放纵地挥霍,让你感觉到我细微的情绪变化,你不会让它们象羽毛一样落到地上,你摊开手掌接受了它们,当我的碎片渐渐都落到了你的身上,你会变得沉重，我却变得轻盈,可以飞到更远的地方,看着你下落，你坠落,在我的海里浮沉 将羽毛浸湿,看着你下落，你坠落,在我的海里浮沉,象孩子一样哭泣,象孩子一样无助,抑制不住的悲伤.','http://www.61baobao.com/common/flash/2011b/06/dpic/0140.jpg','10345','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1cE9IZE5WRkYzVEc1T00xcG5QVDA9','http://s.61baobao.com/common/flash/2011b/06/0140.swf','http://www.61baobao.com/common/flash/2011b/06/dpic/0140.jpg','http://www.61baobao.com/common/flash/2011b/06/pic/0140.jpg','三个月以上','0','0','','0');");
