E_D("replace into `phome_ecms_infotmp_game` values('1294','17','http://www.61baobao.com/tingerge/8289/','0','2012-06-29 01:56:55','童年的小摇车','2012-06-29 01:56:55','4usky','2','1340906215','','http://www.61baobao.com/zt/qinbao/2012/pic/tongnian.jpg','','0','','http://s.61baobao.com/zt/qinbao/2012/tongnian.swf','667','479','那一天妈妈问我,童年最难忘的是什么?<br />在朦胧的记忆中,难忘那小小的摇车.<br />它摇着日月,它摇着星索.<br />它摇着妈妈无字的歌.<br />童年的时光,悄悄地流过.<br />母爱啊,深埋在心窝,深埋在心窝.<br />那一天妈妈问我,童年最难忘的是什么?<br />在朦胧的记忆中,难忘那小小的摇车.<br />它摇着童心,它摇着梦幻,<br />摇来鸟语花香好春色.<br />如今我走向,新的生活,<br />母爱啊,深埋在心窝,深埋在心窝<br />噜.....噜......','http://www.61baobao.com/zt/qinbao/2012/dpic/tongnian.jpg','8289','VEROd01Fd3pSbkJpYlVwb1luazRlVTFFUlhsTU0xSjJZbTFrZFdGWFJuVk1iazR6V21jOVBRPT0=','http://s.61baobao.com/zt/qinbao/2012/tongnian.swf','http://www.61baobao.com/zt/qinbao/2012/dpic/tongnian.jpg','http://www.61baobao.com/zt/qinbao/2012/pic/tongnian.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('1295','17','http://www.61baobao.com/tingerge/8286/','0','2012-06-29 01:56:55','上学歌','2012-06-29 01:56:55','4usky','2','1340906215','','http://www.61baobao.com/3.0/10/pic/046.jpg','','0','','http://s.61baobao.com/zt/qinbao/shangxuege.swf','667','479','太阳当空照，<br />花儿对我笑，<br />小鸟说：早早早，<br />你为什么背上小书包？<br />我去上学校， <br />天天不迟到，<br />爱学习,爱劳动， <br />长大要为人民立功劳！<br /><br />','http://www.61baobao.com/3.0/10/dpic/046.jpg','8286','VEROd01Fd3pSbkJpYlVwb1luazVlbUZIUm5WYU0yZ3hXbGRrYkV4dVRqTmFaejA5','http://s.61baobao.com/zt/qinbao/shangxuege.swf','http://www.61baobao.com/3.0/10/dpic/046.jpg','http://www.61baobao.com/3.0/10/pic/046.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('1296','17','http://www.61baobao.com/tingerge/8284/','0','2012-06-29 01:56:55','四季的歌','2012-06-29 01:56:55','4usky','2','1340906215','','http://www.61baobao.com/common/flash/2011b/04/pic/0205.jpg','','0','','http://s.61baobao.com/common/flash/2011b/04/0205.swf','667','479','春天到黄莺叫黄莺叫<br />杨柳枝随风飘随风飘<br />桃花李花开得好<br />小蜜蜂嗡嗡叫采蜜兴致高<br />嗡……嗡……<br />采蜜兴致高<br /><br />夏天到知了叫知了叫<br />树林里真热闹真热闹<br />清水池塘荷花飘<br />小青蛙咯咯叫捉虫本领高<br />咯……咯……<br />捉虫本领高<br /><br />秋天到蟋蟀叫蟋蟀叫<br />树上落叶随风飘随风飘<br />满园菊花都开了<br />小螃蟹真可笑走路横着跑<br />哈……哈……<br /><br />冬天到乌鸦叫乌鸦叫<br />天上雪花飘雪花飘<br />腊梅花开在树梢<br />小花猫喵喵叫炉边把火烤<br />喵……喵……<br />炉边把火烤<br />','http://www.61baobao.com/common/flash/2011b/04/dpic/0205.jpg','8284','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1RE9IZE5ha0V4VEc1T00xcG5QVDA9','http://s.61baobao.com/common/flash/2011b/04/0205.swf','http://www.61baobao.com/common/flash/2011b/04/dpic/0205.jpg','http://www.61baobao.com/common/flash/2011b/04/pic/0205.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('1297','17','http://www.61baobao.com/tingerge/8279/','0','2012-06-29 01:57:01','美丽的小海螺','2012-06-29 01:57:01','4usky','2','1340906221','','http://www.61baobao.com/3.0/10/pic/039.jpg','','0','','http://s.61baobao.com/zt/qinbao/xiaoluohao.swf','667','479','小海螺小海螺,美丽的小海螺<br />你张开小嘴巴，<br />有啥话要告诉我，有啥话要告诉我，<br />是海底的密秘，<br />还是鱼儿的快乐，还是鱼儿的快乐。<br /><br />小海螺小海螺,可爱的小海螺，<br />你张开小耳朵，<br />听我悄悄对你说，听我悄悄对你说，<br />等我长大了，<br />要到海底去探宝，要到海底去探宝，<br />啦........,要到海底去探宝。','http://www.61baobao.com/3.0/10/dpic/039.jpg','8279','VEROd01Fd3pSbkJpYlVwb1luazVOR0ZYUm5aaVNGWjJZVWRHZGt4dVRqTmFaejA5','http://s.61baobao.com/zt/qinbao/xiaoluohao.swf','http://www.61baobao.com/3.0/10/dpic/039.jpg','http://www.61baobao.com/3.0/10/pic/039.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('1298','17','http://www.61baobao.com/tingerge/8276/','0','2012-06-29 01:57:01','卖花姑娘','2012-06-29 01:57:01','4usky','2','1340906221','','http://www.61baobao.com/zt/qinbao/2012/pic/malanhua.jpg','','0','','http://s.61baobao.com/zt/qinbao/2012/malanhua.swf','667','479','卖花来呦,卖花来呦，<br />朵朵红花多鲜艳，<br />花儿多香,花儿多鲜，<br />美丽的花儿红艳艳，<br />卖了花儿,来呦来呦，<br />治好生病的好妈妈，<br />卖花来呦,卖花来呦，<br />朵朵鲜花红艳艳，<br />从小河边摘来了粉红色的八仙花，<br />从山坡上采来了美丽的金达莱，<br />卖花来呦,卖花来呦，<br />快快来买这束花，<br />让这鲜花和那春光洒满痛苦的胸怀。<br /><br />卖花来呦,卖花来呦<br />花儿好啊红又香<br />朵朵红花卖不完呐<br />滴滴眼泪流不完<br />没有祖国没有权<br />生活之路遇终端<br />在这春暖花开之时<br />终日卖花泪不干<br />卖花来呦,卖花来呦<br />朵朵红花多鲜艳<br />花儿多香,花儿多鲜<br />美丽的花儿红艳艳<br />卖花来呦,卖花来呦<br />花儿好啊红又香<br />朵朵红花卖不完呐<br />滴滴眼泪流不完<br />朵朵红花卖不完呐<br />滴滴眼泪流不完','http://www.61baobao.com/zt/qinbao/2012/dpic/malanhua.jpg','8276','VEROd01Fd3pSbkJpYlVwb1luazRlVTFFUlhsTU1qRm9Za2RHZFdGSVZtaE1iazR6V21jOVBRPT0=','http://s.61baobao.com/zt/qinbao/2012/malanhua.swf','http://www.61baobao.com/zt/qinbao/2012/dpic/malanhua.jpg','http://www.61baobao.com/zt/qinbao/2012/pic/malanhua.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('1299','17','http://www.61baobao.com/tingerge/8267/','0','2012-06-29 01:57:01','两只山羊过桥','2012-06-29 01:57:01','4usky','2','1340906221','','http://www.61baobao.com/zt/qinbao/pic/xiaomaguohe.jpg','','0','','http://s.61baobao.com/zt/qinbao/xiaomaguohe.swf','667','479','河东来了只黑山羊,河西白羊它要过桥,<br />两只山羊呵桥上站,谁也不肯让开道.　<br />东边黑羊它胡子翘,西边白羊它咩咩叫.<br />两只山羊呵使劲吵,谁也不肯让开道.　<br />黑羊叫白羊快闪开,白羊叫黑羊退下桥.<br />黑羊说白羊不讲理,白羊说黑羊没礼貌.<br />两只山羊角对角哎,顶得小桥摇三摇哎.<br />两只山羊角对角哎,顶得小桥摇三摇哎.<br />扑通一声可不好,黑羊白羊洗了澡哎,<br />黑羊白羊洗了澡 ','http://www.61baobao.com/zt/qinbao/dpic/xiaomaguohe.jpg','8267','VEROd01Fd3pSbkJpYlVwb1luazVOR0ZYUm5aaVYwWnVaRmM1YjFwVE5YcGtNbGs5','http://s.61baobao.com/zt/qinbao/xiaomaguohe.swf','http://www.61baobao.com/zt/qinbao/dpic/xiaomaguohe.jpg','http://www.61baobao.com/zt/qinbao/pic/xiaomaguohe.jpg','三个月以上','0','0','','0');");
