E_D("replace into `phome_ecms_infotmp_game` values('1351','17','http://www.61baobao.com/tingerge/7102/','0','2012-06-29 01:58:21','中学时代','2012-06-29 01:58:21','4usky','2','1340906301','','http://www.61baobao.com/common/flash/d/pic/7102.jpg','','0','','http://s.61baobao.com/common/flash/d/7102.swf','667','479','爱是什么<br /><br />我不知道<br /><br />我还不知道<br /><br />我不懂永远<br /><br />我不懂自己<br /><br />谁能懂永远<br /><br />谁能懂自己<br />把百合日记<br />藏在书包<br />我纯真的你<br />我生命中的唯一','http://www.61baobao.com/common/flash/d/dpic/7102.jpg','7102','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVtTjRUVVJKZFdNelpHMD0=','http://s.61baobao.com/common/flash/d/7102.swf','http://www.61baobao.com/common/flash/d/dpic/7102.jpg','http://www.61baobao.com/common/flash/d/pic/7102.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('1352','17','http://www.61baobao.com/tingerge/7101/','0','2012-06-29 01:58:21','月亮耙耙','2012-06-29 01:58:21','4usky','2','1340906301','','http://www.61baobao.com/common/flash/d/pic/7101.jpg','','0','','http://s.61baobao.com/common/flash/d/7101.swf','667','479','肚里坐个爹爹，爹爹出来买菜，<br />肚里坐个奶奶，奶奶出来绣花，<br />绣扎糍粑，糍粑跌得井里，<br />变扎蛤蟆，蛤蟆伸脚，<br />变扎喜鹊，喜鹊上树，<br />变扎斑鸠，斑鸠咕咕咕……<br />----<br />寒星点点眨眼睛，<br />月到中秋分外明，<br />站在水边看月亮，<br />月亮下面是故乡。<br />月光揉在江水里，<br />想起爷爷的声音。<br />今年天气冷得早，<br />秋风清清扰我心。<br />-<br />月亮月亮我问你，<br />今年你多大年纪？<br />明天我会在哪里？<br />什么时候我已长大了，<br />你却依然很平静？<br />----<br />故事一年又一年，<br />(故事一年又一年)<br />思念一天又一天，<br />(思念一天啊)<br />远方的人你是否，<br />(你是否)<br />依然儿时的容颜。','http://www.61baobao.com/common/flash/d/dpic/7101.jpg','7101','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVtTjRUVVJGZFdNelpHMD0=','http://s.61baobao.com/common/flash/d/7101.swf','http://www.61baobao.com/common/flash/d/dpic/7101.jpg','http://www.61baobao.com/common/flash/d/pic/7101.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('1353','17','http://www.61baobao.com/tingerge/7100/','0','2012-06-29 01:58:28','月亮谜语歌','2012-06-29 01:58:28','4usky','2','1340906308','','http://www.61baobao.com/common/flash/d/pic/7100.jpg','','0','','http://s.61baobao.com/common/flash/d/7100.swf','667','479','星星亮闪闪，夜空深又蓝。<br />我唱一支月亮歌，小朋友谁能答周全？<br />你唱一支月亮歌，小聪聪我能答周全。<br />什么日子月亮看不见？什么日子月亮一条线？<br />什么日子像镰刀？什么日子圆又圆？<br />初一初二月亮看不见，初三初四月亮一条线，<br />初五初六像镰刀，十五十六圆又圆，<br />星星亮闪闪，对我眨眼。月亮歌儿唱得妙，<br />它也把咱来称赞。<br />','http://www.61baobao.com/common/flash/d/dpic/7100.jpg','7100','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVtTjRUVVJCZFdNelpHMD0=','http://s.61baobao.com/common/flash/d/7100.swf','http://www.61baobao.com/common/flash/d/dpic/7100.jpg','http://www.61baobao.com/common/flash/d/pic/7100.jpg','三个月以上','0','0','','0');");
