E_D("replace into `phome_ecms_infotmp_game` values('1372','17','http://www.61baobao.com/tingerge/7080/','0','2012-06-29 01:58:54','猴子学样','2012-06-29 01:58:54','4usky','2','1340906334','','http://www.61baobao.com/common/flash/d/pic/7080.jpg','','0','','http://s.61baobao.com/common/flash/d/7080.swf','667','479','一天，一位卖帽人挑着一担帽子去卖。走到森林里，他觉得太累了，便在一棵大树下睡着了。<br /><br />一群调皮的小猴子来到大树下，每个猴子戴上一顶帽子，爬到了大树上。卖帽人一觉醒来，揉揉眼睛。突然，他发现自己的帽子不见了，便四处寻找。抬头一看，原来是猴子拿走了他的帽子。他急得对猴子大喊：“快把帽子还给我！”小猴子也哇啦哇啦地跟着大叫；卖帽人急得跺脚，小猴子也跟着跺脚；卖帽人急得抓耳挠腮，小猴子们也跟着抓耳挠腮。卖帽人眼睛一亮，啊！原来调皮的猴子爱模仿人的动作。于是，他将帽子从头上摘下来往地下一扔。猴子们也纷纷把帽子从头上摘下来往树下扔。卖帽人赶紧拾起地上的帽子。挑起担子得意洋洋地走了<br />','http://www.61baobao.com/common/flash/d/dpic/7080.jpg','7080','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVtTjNUMFJCZFdNelpHMD0=','http://s.61baobao.com/common/flash/d/7080.swf','http://www.61baobao.com/common/flash/d/dpic/7080.jpg','http://www.61baobao.com/common/flash/d/pic/7080.jpg','三个月以上','0','0','','0');");
