E_D("replace into `phome_ecms_infotmp_game` values('1387','17','http://www.61baobao.com/tingerge/7065/','0','2012-06-29 01:59:18','光阴的故事-张艾嘉','2012-06-29 01:59:18','4usky','2','1340906358','','http://www.61baobao.com/common/flash/d/pic/7065.jpg','','0','','http://s.61baobao.com/common/flash/d/7065.swf','667','479','春天的花开秋天的风以及冬天的落阳<br />忧郁的青春年少的我曾经无知的这么想<br />光阴它带走四季里的歌我轻轻地悠唱<br />风花雪月的诗句里我在年年的成长<br />流水它带走光阴的故事改变了一个人<br />就在那多愁善感而初次等待的青春<br />发黄的相片古老的信以及褪色的圣诞卡<br />年轻时为你写的歌恐怕你早已忘了吧<br />过去的誓言就象那课本里缤纷的书签<br />刻划着多少美丽的诗可是终究是一阵烟<br />流水它带走光阴的故事改变了两个人<br />就在那多愁善感而初次流泪的青春<br />遥远的路程昨日的梦以及远去的笑声<br />再次的见面我们又历经了多少的路程<br />不再是旧日熟悉的你有着旧日狂热的梦<br />也不是旧日熟悉的我有着依然的笑容<br />流水它带走光阴的故事改变了我们<br />就在那多愁善感而初次回忆的青春','http://www.61baobao.com/common/flash/d/dpic/7065.jpg','7065','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVtTjNUbXBWZFdNelpHMD0=','http://s.61baobao.com/common/flash/d/7065.swf','http://www.61baobao.com/common/flash/d/dpic/7065.jpg','http://www.61baobao.com/common/flash/d/pic/7065.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('1388','17','http://www.61baobao.com/tingerge/7064/','0','2012-06-29 01:59:18','灌篮高手','2012-06-29 01:59:18','4usky','2','1340906358','','http://www.61baobao.com/common/flash/d/pic/7064.jpg','','0','','http://s.61baobao.com/common/flash/d/7064.swf','667','479','大都会に仆はもう一人で<br />投げ舍てられた空カンのようだ<br />互いのすべてを知りつくすまでが<br />爱ならばいっそ永久に眠ろうか<br />世界が终るまでは离れる事もない<br />そう愿っていた几千の夜と<br />戾らない时だけが何故辉いては<br />やつれ切った心までも坏す<br />はかなき想いこの<br />そして人は形を求めて<br />かけがえのない何かを失う<br />欲望だらけの街じゃ夜空の<br />星屑も仆らを灯せない<br />世界が终る前に闻かせておくれよ<br />满开の花が似合いの<br />谁もが望みながら永远を信じない<br />なのにきっと明日を梦见てる<br />はかなき日々とこの<br />世界が终るまでは离れる事もない<br />そう愿っていた几千の夜と<br />戾らない时だけが何故辉いては<br />やつれ切った心までも坏す<br />はかなき想いこの','http://www.61baobao.com/common/flash/d/dpic/7064.jpg','7064','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVtTjNUbXBSZFdNelpHMD0=','http://s.61baobao.com/common/flash/d/7064.swf','http://www.61baobao.com/common/flash/d/dpic/7064.jpg','http://www.61baobao.com/common/flash/d/pic/7064.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('1389','17','http://www.61baobao.com/tingerge/7063/','0','2012-06-29 01:59:24','古丽','2012-06-29 01:59:24','4usky','2','1340906364','','http://www.61baobao.com/common/flash/d/pic/7063.jpg','','0','','http://s.61baobao.com/common/flash/d/7063.swf','667','479','有多少小姑娘都叫古丽<br />我不知道那个古丽就是你<br />为什么你有一个花一样的名字<br />是不是古丽都比鲜花美丽<br />叫古丽的全都是<br />维吾尔姑娘<br />维吾尔人总和花朵生活在一起<br />风沙它吹落了花园的花朵<br />头上那顶小花帽美丽无比<br />噢<br />古丽古丽<br />曲蔓古丽<br />古丽古丽<br />巴哈古丽<br />古丽古丽<br />阿依古丽<br />古丽古丽<br />茹仙古丽<br />叫古丽的全都是<br />维吾尔姑娘<br />维吾尔人总和花朵生活在一起<br />风沙它吹落了花园的花朵<br />头上那顶小花帽美丽无比<br />噢<br />古丽古丽<br />梦中的你<br />古丽古丽<br />美丽无比<br />古丽古丽<br />你在哪里<br />古丽古丽<br />在我心里','http://www.61baobao.com/common/flash/d/dpic/7063.jpg','7063','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVtTjNUbXBOZFdNelpHMD0=','http://s.61baobao.com/common/flash/d/7063.swf','http://www.61baobao.com/common/flash/d/dpic/7063.jpg','http://www.61baobao.com/common/flash/d/pic/7063.jpg','三个月以上','0','0','','0');");
