E_D("replace into `phome_ecms_infotmp_game` values('1391','17','http://www.61baobao.com/tingerge/6950/','0','2012-06-29 01:59:24','家族歌','2012-06-29 01:59:24','4usky','2','1340906364','','http://www.61baobao.com/common/flash/d/pic/6950.jpg','','0','','http://s.61baobao.com/common/flash/d/6950.swf','667','479','爸的爸爸叫什么？爸爸的爸爸叫爷爷；爸爸的妈妈叫什么？爸爸的妈妈叫奶奶；爸爸的哥哥叫什么？爸爸的哥哥叫伯伯；爸爸的弟弟叫什么？爸爸的弟弟叫叔叔；爸爸的姐妹叫什么？爸爸的姐妹叫姑姑。<br /><br />妈妈的爸爸叫什么？妈妈的爸爸叫外公；妈妈的妈妈叫什么？妈妈的妈妈叫外婆；妈妈的兄弟叫什么？妈妈的兄弟叫舅舅；妈妈的姐妹叫什么？妈妈的姐妹叫阿姨。<br /><br />爷爷，爸爸的爸爸叫爷爷；奶奶，爸爸的妈妈叫奶奶；伯伯，爸爸的哥哥叫伯伯；叔叔，爸爸的弟弟叫叔叔；<br /><br />外公，妈妈的爸爸叫外公；外婆，妈妈的妈妈叫外婆；舅舅，妈妈的兄弟叫外舅舅；阿姨，妈妈的姐妹叫阿姨。','http://www.61baobao.com/common/flash/d/dpic/6950.jpg','6950','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVsazFUbFJCZFdNelpHMD0=','http://s.61baobao.com/common/flash/d/6950.swf','http://www.61baobao.com/common/flash/d/dpic/6950.jpg','http://www.61baobao.com/common/flash/d/pic/6950.jpg','三个月以上','0','0','','0');");
