E_D("replace into `phome_ecms_infotmp_game` values('1400','17','http://www.61baobao.com/tingerge/6935/','0','2012-06-29 01:59:36','父亲','2012-06-29 01:59:36','4usky','2','1340906376','','http://www.61baobao.com/common/flash/d/pic/6935.gif','','0','','http://s.61baobao.com/common/flash/d/6935.swf','667','479','那是我小时候 ,常坐在父亲肩头 ,<br />父亲是儿那登天的梯 ,父亲是那拉车的牛 ,<br />忘不了粗茶淡饭将我养大 ,<br />忘不了一声长叹半壶老酒 ,<br />等我长大后 ,山里孩子往外走 ,<br />想儿时一封家书千里写叮嘱 ,<br />盼儿归一袋闷烟满天数星斗 ,<br />都说养儿能防老 ,可儿山高水远他乡留 ,<br />都说养儿为防老 ,可你再苦再累不张口 ,<br />儿只有清歌一曲和泪唱 ,愿天下父母平安度春秋 ,<br />那是我小时候 ,常坐在父亲肩头 ,<br />父亲是儿那登天的梯 ,父亲是那拉车的牛 ,<br />忘不了粗茶淡饭将我养大 ,忘不了一声长叹半壶老酒.','http://www.61baobao.com/common/flash/d/dpic/6935.gif','6935','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVsazFUWHBWZFdNelpHMD0=','http://s.61baobao.com/common/flash/d/6935.swf','http://www.61baobao.com/common/flash/d/dpic/6935.gif','http://www.61baobao.com/common/flash/d/pic/6935.gif','三个月以上','0','0','','0');");
